package org.apache.camel.component.cache;

public class PoetryNotSerializable {

    private String poet;
    private String poem;

    public String getPoet() {
        return poet;
    }
    public void setPoet(String poet) {
        this.poet = poet;
    }
    public String getPoem() {
        return poem;
    }
    public void setPoem(String poem) {
        this.poem = poem;
    }
}
